d3.custom = {};
d3.custom.slopegraph = function() {

    var opts = {
        width: window.width,
        height: 1300,
        margin: {top: 50, right: 10, bottom: 50, left: 150},
        labelLength: 200
    };

    function exports(selection) {
        selection.each(function (dataset) {
            var chartHeight = opts.height - opts.margin.top - opts.margin.bottom;
            var chartWidth = opts.width - opts.margin.right - opts.margin.left;

            var parent = d3.select(this);
            var svg = parent.selectAll("svg.chart-root").data([0]);
            svg.enter().append("svg").attr("class", "chart-root")
                    .append('g').attr('class', 'chart-group');
            svg.attr({width: opts.width, height: opts.height});
            svg.exit().remove();
            var chartSvg = svg.select('.chart-group');

            var data = dataset.data;
            var scale = d3.scale.linear().domain(d3.extent(d3.merge(data))).range([0, chartHeight]);

            var scale2 = d3.scale.linear().domain([0,100]).range([0, chartHeight]);
            var scale3 = d3.scale.linear().domain([0,100]).range([0, chartHeight]);

            console.log(data)
            var lines = chartSvg.selectAll('path.slope-line')
                .data(data);
            lines.enter().append("path")
            lines.attr('class','slope-line').attr('d', function(d){
                var start_x = opts.margin.left + opts.labelLength;
                var start_y = opts.margin.top + scale(d[0]);
                var end_x = opts.width - opts.margin.right - opts.labelLength;
                var end_y = opts.margin.top + scale(d[1]);
                //console.log("(" + start_x + ", " + start_y + ") (" + end_x + ", " + end_y + ")")
                return "M" + start_x + "," + start_y
                + " C" + (start_x + (end_x - start_x)/4) + "," + start_y
                + " " + (start_x + 3*((end_x - start_x)/4)) + ","+ end_y
                + " " + end_x + "," + end_y;
            })
/*            lines.attr({
                    class: 'slope-line',
                    x1: opts.margin.left + opts.labelLength,
                    x2: opts.width - opts.margin.right - opts.labelLength,
                    y1: function(d) { console.log(scale(d[0])); return opts.margin.top + scale(d[0]); },
                    y2: function(d) { return opts.margin.top + scale(d[1]); }});*/
            lines.exit().remove();

/// LEFT LABELS
            var left_pos_data = dataset.position[0];

            var leftLabels = chartSvg.selectAll('text.left_labels')
                .data(left_pos_data);
            leftLabels.enter().append('text');
            leftLabels.attr({
                    class: 'left_labels slope-label',
                    x: opts.margin.left + opts.labelLength,
                    y: function(d,i) { return opts.margin.top + scale3(d); },
                    dy: '.35em',
                    'text-anchor': 'end'})
                .text(function(d,i) { return dataset.label[0][i] }).style("font-size","12px");
            leftLabels.exit().remove();

/// RIGHT LABELS
            var right_pos_data = dataset.position[1];

            var rightLabels = chartSvg.selectAll('text.right_labels')
                .data(right_pos_data);
            rightLabels.enter().append('text');
            rightLabels.attr({
                    class: 'right_labels slope-label',
                    x: opts.width - opts.margin.right - opts.labelLength,
                    y: function(d,i) { return opts.margin.top + scale2(d); },
                    dy: '.35em'})
                .text(function(d,i) { return dataset.label[1][i] }).style("font-size","12px");
            rightLabels.exit().remove();
        });
    }

    exports.opts = opts;
    createAccessors(exports);

    return exports;
}


createAccessors = function(visExport) {
    for (var n in visExport.opts) {
        if (!visExport.opts.hasOwnProperty(n)) continue;
        visExport[n] = (function(n) {
            return function(v) {
                return arguments.length ? (visExport.opts[n] = v, this) : visExport.opts[n];
            }
        })(n);
    }
};

